        public override void ShowCharacteristics()
        {
            base.ShowCharacteristics();
            Console.WriteLine($"\nÐ¢Ð¾Ñ‡Ð½Ñ‹Ð¹ ÑƒÐ´Ð°Ñ€ - ÐºÐ°Ð¶Ð´Ñ‹Ð¹ {_criticalImpactForce} ÑƒÐ´Ð°Ñ€ Ð½Ð°Ð½Ð¾ÑÐ¸Ñ‚ Ñ ÑÐ¸Ð»Ð¾Ð¹ Ð² {_powerAccurateImpact} Ñ€Ð°Ð·Ð°. (ÐÐµ Ð¼Ð¾Ð¶ÐµÑ‚ Ð±Ñ‹Ñ‚ÑŒ ÐºÑ€Ð¸Ñ‚Ð¸Ñ‡ÐµÑÐºÐ¸Ð¼)");
            Console.WriteLine($"ÐšÑ€Ð¸Ñ‚Ð¸Ñ‡ÐµÑÐºÐ¸Ð¹ ÑƒÐ´Ð°Ñ€ - ÑˆÐ°Ð½Ñ {_ÑhanceCriticalHit}% Ð½Ð°Ð½ÐµÑÑ‚Ð¸ ÑƒÐ´Ð°Ñ€ Ñ ÑÐ¸Ð»Ð¾Ð¹ Ð² {_powerCriticalStrike} Ñ€Ð°Ð·Ð°.");
        }
 
        public override void Strike(Gladiator opponent)
        {
            _attackCount++;
            int baseDamage = Damage;
 
            if (ReturnTrueAccurateHit())
            {
                Damage *= _powerAccurateImpact;
                opponent.TakeDamage(Damage, opponent.Armor, "ÐÐ°Ð½ÐµÑ Ñ‚Ð¾Ñ‡Ð½Ñ‹Ð¹ ÑƒÐ´Ð°Ñ€");
            }
            else if (ReturnTrueCriticalHit())
            {
