            }
 
            Damage = baseDamage;
        }
 
        private bool ReturnTrueAccurateHit()
        {
            int initialNumberStrokes = 0;
 
            bool isAccurateHit = (_attackCount == _criticalImpactForce);
            _attackCount = isAccurateHit ? initialNumberStrokes : _attackCount;
 
            return isAccurateHit;
