    class Berserk : Gladiator
    {
        private int _furyActivationThreshold;
        private int _increasedAttackPower;
        private int _increasedProtection;
        private int _baseHealth;
 
        private bool _isActiveFury;
        private bool _isTakingDamage;
 
        public Berserk() : base("Ð‘ÐµÑ€ÑÐµÑ€Ðº", 920, 15, 50)
        {
            _furyActivationThreshold = 50;
            _increasedAttackPower = 10;
            _increasedProtection = 50;
            _baseHealth = Health;
 
            _isActiveFury = false;
            _isTakingDamage = false;
        }
 
        public override void ShowCharacteristics()
        {
            base.ShowCharacteristics();
            Console.WriteLine($"\nÐÐµÑƒÑ‚Ð¾Ð¼Ð¸Ð¼Ð¾ÑÑ‚ÑŒ - Ð¿Ñ€Ð¸ Ð¿Ð¾Ð»ÑƒÑ‡ÐµÐ½Ð¸Ð¸ ÑƒÑ€Ð¾Ð½Ð° ÑÐ¸Ð»Ð° Ð°Ñ‚Ð°ÐºÐ¸ Ð¿Ð¾Ð²Ñ‹ÑˆÐ°ÐµÑ‚ÑÑ Ð½Ð° {_increasedAttackPower}% Ð·Ð° ÐºÐ°Ð¶Ð´Ñ‹Ð¹ ÑƒÐ´Ð°Ñ€.");
            Console.WriteLine($"Ð¯Ñ€Ð¾ÑÑ‚ÑŒ - ÐºÐ¾Ð³Ð´Ð° ÑÐ²Ð¾Ðµ Ð·Ð´Ð¾Ñ€Ð¾Ð²ÑŒÐµ ÑƒÐ¿Ð°Ð´ÐµÑ‚ Ð´Ð¾ {_furyActivationThreshold}%, ÐµÐ³Ð¾ Ð·Ð°Ñ‰Ð¸Ñ‚Ð° Ð¾Ð´Ð¸Ð½ Ñ€Ð°Ð· ÑƒÐ²ÐµÐ»Ð¸Ñ‡ÐµÐ²Ð¸Ñ‚ÑÑ Ð½Ð° {_increasedProtection}%.");
        }
 
        public override void Strike(Gladiator opponent)
        {
            int numberForPercentages = 100;
            int boostDamage = (Damage * _increasedAttackPower) / numberForPercentages;
            Damage += boostDamage;
 
            UnleashFury();
 
            if (_isTakingDamage)
            {
                Console.WriteLine($"ÐÑ‚Ð°ÐºÐ° ÑƒÐ²ÐµÐ»Ð¸Ñ‡Ð¸Ð½Ð° Ð½Ð° {boostDamage}");
                opponent.TakeDamage(Damage, opponent.Armor, "ÐÐ°Ð½ÐµÑ Ð¾Ð±Ñ‹Ñ‡Ð½Ñ‹Ð¹ ÑƒÐ´Ð°Ñ€");
                _isTakingDamage = false;
            }
            else
            {
                opponent.TakeDamage(Damage, opponent.Armor, "ÐÐ°Ð½ÐµÑ Ð¾Ð±Ñ‹Ñ‡Ð½Ñ‹Ð¹ ÑƒÐ´Ð°Ñ€");
            }
        }
 
        public override void TakeDamage(int damage, int armor, string text)
        {
            if (damage - armor < 0)
            {
                return;
            }
 
            Health -= damage - Armor;
            _isTakingDamage = true;
 
            if (Health <= 0)
                Health = 0;
 
            Console.WriteLine(text);
        }
 
        private void UnleashFury()
        {
            int numberForPercentages = 100;
 
            if (Health <= (_baseHealth * _furyActivationThreshold) / numberForPercentages && _isActiveFury == false)
            {
                _isActiveFury = true;
                int furyArmor = Armor + (Armor * _increasedProtection) / numberForPercentages;
                Armor = furyArmor;
                Console.WriteLine("Ð¯Ñ€Ð¾ÑÑ‚ÑŒ Ð°ÐºÑ‚Ð¸Ð²Ð¸Ñ€Ð¾Ð²Ð°Ð½Ð½Ð°");
            }
            else if (_isActiveFury == true)
            {
                Console.WriteLine("Ð¯Ñ€Ð¾ÑÑ‚Ð½Ñ‹Ð¹");
            }
            else if (Health >= (_baseHealth * _furyActivationThreshold) / numberForPercentages && _isActiveFury == true)
            {
                int furyArmor = Armor - (Armor * _increasedProtection) / numberForPercentages;
                Armor = furyArmor;
                _isActiveFury = false;
            }
        }
    }
 
