                    opponent.TakeDamage(currentDamage, opponent.Armor, "ÐÐ°Ð½ÐµÑ Ð¾ÑÐ»ÐµÐ¿Ð»ÑÑŽÑ‰Ð¸Ð¹ ÑƒÐ´Ð°Ñ€");
