        public override void TakeDamage(int damage, int armor, string text)
        {
            if (damage - armor < 0)
            {
                return;
            }
 
            if (_isBlind)
            {
                _isBlind = false;
                Console.WriteLine("ÐžÑÐ»ÐµÐ¿Ð»ÐµÐ½");
            }
            else
