            };
 
            for (int i = 0; i < gladiators.Count; i++)
            {
                Console.WriteLine($"\n\t\tÐ“Ð»Ð°Ð´Ð¸Ð°Ñ‚Ð¾Ñ€ Ð½Ð¾Ð¼ÐµÑ€_{i + 1}\n");
                gladiators[i].ShowCharacteristics();
            }
 
            Gladiator selectedGladiator = null;
 
            Console.WriteLine("\nÐ’Ð²ÐµÐ´Ð¸Ñ‚Ðµ Ð½Ð¾Ð¼ÐµÑ€ Ð³Ð»Ð°Ð´Ð¸Ð°Ñ‚Ð¾Ñ€Ð°");
 
            bool isWorks = true;
 
            while (isWorks)
