    class Arena
    {
        public void Work()
        {
            Console.WriteLine("\nÐ’Ñ‹Ð±ÐµÑ€Ð¸Ñ‚Ðµ Ð¿ÐµÑ€Ð²ÑƒÑŽ ÐºÐ¾Ð¼Ð°Ð½Ð´Ñƒ Ð³Ð»Ð°Ð´Ð¸Ð°Ñ‚Ð¾Ñ€Ð¾Ð²\n");
            Team teamOne = new Team();
 
            Console.WriteLine("\nÐ’Ñ‹Ð±ÐµÑ€Ð¸Ñ‚Ðµ Ð²Ñ‚Ð¾Ñ€ÑƒÑŽ ÐºÐ¾Ð¼Ð°Ð½Ð´Ñƒ Ð³Ð»Ð°Ð´Ð¸Ð°Ñ‚Ð¾Ñ€Ð¾Ð²\n");
            Team teamSecond = new Team();
 
            Console.Clear();
 
            teamOne.ShowCommand("ÐŸÐµÑ€Ð²Ð°Ñ ÐºÐ¾Ð¼Ð°Ð½Ð´Ð°:\n");
            teamSecond.ShowCommand("\nÐ’Ñ‚Ð¾Ñ€Ð°Ñ ÐºÐ¾Ð¼Ð°Ð½Ð´Ð°:\n");
 
            Console.WriteLine("\n-ÐÐ°Ð¶Ð¼Ð¸Ñ‚Ðµ Ð»ÑŽÐ±ÑƒÑŽ ÐºÐ»Ð°Ð²Ð¸ÑˆÑƒ Ñ‡Ñ‚Ð¾Ð±Ñ‹ Ð½Ð°Ñ‡Ð°Ñ‚ÑŒ Ð±Ð¾Ð¹!-\n");
            Console.ReadKey();
            Console.Clear();
 
            Battle(teamOne, teamSecond);
        }
 
        private void Battle(Team teamOne, Team teamSecond)
        {
            List<Team> gladiatorTeams = new List<Team> { teamOne, teamSecond };
 
            int numberToAttackFirst = 50;
            int first = 0;
            int second = 1;
            int numberRound = 1;
 
            while (teamOne.FightersCount > 0 && teamSecond.FightersCount > 0)
            {
                int firstStrike = Utilities.GetRandomPercent();
 
                if (firstStrike > numberToAttackFirst)
                {
                    first = 0;
                    second = 1;
                }
                else
                {
                    first = 1;
                    second = 0;
                }
 
                Console.WriteLine("Ð Ð°ÑƒÐ½Ð´ " + numberRound);
                numberRound++;
 
                Console.WriteLine("\nÐ‘ÑŒÑŽÑ‚ Ð¿ÐµÑ€Ð²Ñ‹Ð¼Ð¸");
                DetermineQueue(gladiatorTeams, first, second);
 
                Console.WriteLine("\nÐ‘ÑŒÑŽÑ‚ Ð²Ñ‚Ð¾Ñ€Ñ‹Ð¼Ð¸");
                DetermineQueue(gladiatorTeams, second, first);
 
                Console.ReadKey();
                Console.Clear();
            }
 
            ShowWinner(gladiatorTeams, first, second);
            ShowWinner(gladiatorTeams, second, first);
        }
 
        private void DetermineQueue(List<Team> gladiatorTeams, int indexFirst, int indexSecond)
        {
            if (gladiatorTeams[indexFirst].FightersCount > 0)
            {
                Console.WriteLine("\nÐ“Ð»Ð°Ð´Ð¸Ð°Ñ‚Ð¾Ñ€Ñ‹ " + (indexFirst + 1) + " ÐºÐ¾Ð¼Ð°Ð½Ð´Ñ‹ Ð½Ð°Ð½Ð¾ÑÑÑ‚ ÑƒÐ´Ð°Ñ€");
 
                for (int i = 0; i < gladiatorTeams[indexFirst].FightersCount; i++)
                {
                    gladiatorTeams[indexFirst].ReturnGladiators()[i].ShowNameHealth();
                    int randomGladiatorIndex = Utilities.GetRandomNumber(gladiatorTeams[indexSecond].FightersCount - 1);
 
                    if (gladiatorTeams[indexSecond].FightersCount <= 0)
                        return;
 
                    gladiatorTeams[indexFirst].ReturnGladiators()[i].Strike(gladiatorTeams[indexSecond].ReturnGladiators()[randomGladiatorIndex]);
 
                    for (int j = 0; j < gladiatorTeams[indexSecond].FightersCount; j++)
                    {
                        gladiatorTeams[indexSecond].RemoveGladiator();
                    }
                }
 
                Console.WriteLine("--------------------");
            }
        }
 
        private void ShowWinner(List<Team> gladiatorTeams, int indexFirst, int indexSecond)
        {
            if (gladiatorTeams[indexFirst].FightersCount > 0 && gladiatorTeams[indexSecond].FightersCount <= 0)
            {
                Console.WriteLine($"\nÐ“Ð»Ð°Ð´Ð¸Ð°Ñ‚Ð¾Ñ€Ñ‹ {indexFirst + 1} ÐºÐ¾Ð¼Ð°Ð½Ð´Ñ‹ Ð¿Ð¾Ð±ÐµÐ´Ð¸Ð»Ð¸");
            }
        }
    }
