// Parses .csv file using comma as delimeter, as long as we can read from fileIn.
bool readCSV(fstream &fileIn, string &record)
{
    char c;
    record = "";
    if (!(fileIn >> c))
        return false;

    while (c != ',')
    {
        record = record + c;
        if (!(fileIn >> c))
            return false;
    }
    return true;
}

