template <typename T>
class ListNode
{
    public:
        T data;
        ListNode<T> *next;

        ListNode() {next = NULL;};
};


template <typename T>
class List
{
    private:
        ListNode<T> *first, *current, *prev;

        void swap(ListNode<T> *p1, ListNode<T> *p2);

    public:
        List();
        ~List();
        void add(T data);
        bool gotoFirst();
        bool gotoNext();
        bool getCurrent(T &data);
        bool deleteCurrent();
        bool search(T d);
        void sort();
        string sortState;
};

#include "List.cpp"

template <typename T>
List<T>::List()
{
    first = NULL;
    current = NULL;
    prev = NULL;
}


template <typename T>
List<T>::~List()
{
    gotoFirst();
    while (deleteCurrent())
        gotoFirst();
}


template <typename T>
void List<T>::add(T d)
{
    ListNode<T> *newNode = new ListNode<T>();
    newNode->data = d;
    newNode->next = first;
    first = newNode;

}


template <typename T>
bool List<T>::gotoFirst()
{
    prev = NULL;
    if (first == NULL)
        return false;
    current = first;
    return true;
}


template <typename T>
bool List<T>::gotoNext()
{
    if (current == NULL)
        return false;
    prev = current;
    current = current->next;
    return true;
}


template <typename T>
bool List<T>::getCurrent(T &d)
{
    if (current == NULL)
        return false;
    d = current->data;
    return true;
}


template <typename T>
bool List<T>::deleteCurrent()
{
    if (current == NULL)
        return false;
    if (current == first)
    {
        first = first->next;
        delete current;
    }
    else
    {
        prev->next = current->next;
        delete current;
    }
    current = NULL;
    prev = NULL;
    return true;
}


template <typename T>
bool List<T>::search(T d)
{
    gotoFirst();
    T data;
    while (getCurrent(data))
    {
        if (data == d)
            return true;
        gotoNext();
    }
    return false;
}

template <typename T>
void List<T>::swap(ListNode<T> *p1, ListNode<T> *p2)
{
    T temp = p1->data;
    p1->data = p2->data;
    p2->data = temp;
}


template <typename T>
void List<T>::sort()
{
    if (first == NULL)
        return;
    bool sorted = true;
    ListNode<T> *i = first;
    while (i->next != NULL)
    {
        if (i->data > i->next->data)
        {
            swap (i,i->next);
            sorted = false;
        }
        i = i->next;
    }
    if (!sorted)
        sort();
}

# flattens arbitrarily nested sequences
# example: lst = [[1, 2, 3], [7, 3, 4], [2, 5, 6, [11, 12, 13]]]
# returns: [1, 2, 3, 7, 3, 4, 2, 5, 6, 11, 12, 13]

def flatten(items: Sequence, seqtypes=(list, tuple)) -> Sequence:
    """flattens arbitrarily nested lists
    :param :items sequence containing nested items
    :returns flattend result"""
    
    try:
        for i, x in enumerate(items):
            while isinstance(x, seqtypes):    
                items[i:i+1] = x
                x = items[i]
    except IndexError:
        pass
    return items

